import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import TextareaAutosize from '@material-ui/core/TextareaAutosize';
import CssBaseline from '@material-ui/core/CssBaseline';
import Container from '@material-ui/core/Container';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import PlayArrowIcon from '@material-ui/icons/PlayArrow';
import PinDropIcon from '@material-ui/icons/PinDrop';
import RoomIcon from '@material-ui/icons/Room';
import TextField from '@material-ui/core/TextField';
import ToggleButton from '@material-ui/lab/ToggleButton';
import ToggleButtonGroup from '@material-ui/lab/ToggleButtonGroup';




const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function Questions() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);
  const [pinType, setPinType] = React.useState('opp');

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleAlignment = (event, newAlignment) => {
    setPinType(newAlignment);
  };

  return (
    <div className={classes.root}>
      <Container>
        <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper className={classes.paper}><PlayArrowIcon /></Paper>
        </Grid>
        <Grid item xs={12} sm={4}>

      <Paper>
      <Box m={2}>
      <Box fontStyle="italic">
      Transcript
      </Box>

        <Typography > Transcription
0:03
Am I starting now? Um, I guess, should I ask the person to continue thinking out loud? I guess? Yeah, we can share
this soon or yeah, you can think out loud for this part too. Okay.
0:15
I think I will press join now.
0:26
Hmm.
0:35
Am I starting up?
0:40
What's the problem for you? I guess? Um, yeah, I think it's been a hard time, um, that, um, I was just been unable
to concentrate on a lot of things at work. Um, so what made you difficult on them? Concentrating on your stove?
1:05
Um, yeah, so I just broke up with my boyfriend, um, a couple weeks ago and I don't know, I guess things have kind
of went down since then.
1:19
Mm. So
1:22
are you having, like, are you planning to do surgeon type of therapy or. What are you planning to do kind of to
overcome your difficulties? Yeah, so I think that's mainly why I came here. And also, um, I don't know. I was
thinking of also getting started on some medication. Mm.
1:47
So what specific medication are you looking forward or trying out?</Typography>
        </Box>
        </Paper>

        </Grid>
        <Grid item xs={12} sm={8}>

      <Paper>
      <Box m={2}>
      <Box fontStyle="italic">
      The session was pinned at 5:10
      </Box>
      <TextField
        id="outlined-secondary"
        label="Personal Notes..."
        fullWidth
        variant="outlined"
        multiline
        rows={4}
        margin="normal"
        color="secondary"
      />

<Box fontStyle="italic"> To share with your peer:</Box>
        <Typography> What is your perspective of what happened at this pin?</Typography>
        <TextField
        id="outlined-secondary"
        label="Type a response..."
        fullWidth
        variant="outlined"
        multiline
        rows={4}
        margin="normal"
        color="secondary"
      />
        <Typography> What would you categorize this pin as?</Typography>
        <ToggleButtonGroup
        value = {pinType}
      exclusive
      align="right"
      onChange={handleAlignment}
    >
      <ToggleButton value="strength">
        Strength
      </ToggleButton>
      <ToggleButton value="opp">
        Opportunity
      </ToggleButton>
    </ToggleButtonGroup> 
        </Box>
        </Paper>

      </Grid>
      </Grid>
      </Container>
    </div>
  );
}
